-- -----------------------------------------------------
-- Table `frequent_asked_question`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `frequent_asked_question`
(
    `id_faq`     INT         NOT NULL AUTO_INCREMENT,
    `question`   VARCHAR(50) NOT NULL,
    `tx_id`      INT         NOT NULL,
    `tx_host`    VARCHAR(50) NOT NULL,
    `tx_user_id` INT         NOT NULL,
    `tx_date`    TIMESTAMP   NOT NULL,
    PRIMARY KEY (`id_faq`)
);

-- -----------------------------------------------------
-- Table `transactions`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `transactions`
(
    `tx_id`      INT         NOT NULL AUTO_INCREMENT,
    `tx_host`    VARCHAR(50) NOT NULL,
    `tx_user_id` INT         NOT NULL,
    `tx_date`    TIMESTAMP   NOT NULL,
    PRIMARY KEY (`tx_id`)
);

-- -----------------------------------------------------
-- Table `user`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `user`
(
    `id_user`    INT          NOT NULL AUTO_INCREMENT,
    `username`   VARCHAR(50)  NOT NULL,
    `password`   VARCHAR(30)  NOT NULL,
    `name`       VARCHAR(50)  NOT NULL,
    `last_name`  VARCHAR(50)  NOT NULL,
    `email`      VARCHAR(60)  NOT NULL,
    `genero`     BINARY       NOT NULL,
    `photo`      VARCHAR(300) NOT NULL,
    `status`     INT          NOT NULL,
    `tx_host`    VARCHAR(100) NOT NULL,
    `tx_user_id` INT          NOT NULL,
    `tx_date`    TIMESTAMP    NOT NULL,
    PRIMARY KEY (`id_user`)
);

-- -----------------------------------------------------
-- Table `sentiment`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `sentiment`
(
    `id_sentiment` INT        NOT NULL AUTO_INCREMENT,
    `positive`     DECIMAL(8) NOT NULL,
    `negative`     DECIMAL(8) NOT NULL,
    `neutral`      DECIMAL(8) NOT NULL,
    `mixed`        DECIMAL(8) NOT NULL,
    PRIMARY KEY (`id_sentiment`)
);

-- -----------------------------------------------------
-- Table `results`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `results`
(
    `id_results`             INT NOT NULL AUTO_INCREMENT,
    `id_user`                INT NOT NULL,
    `sentiment_id_sentiment` INT NOT NULL,
    PRIMARY KEY (`id_results`),
    CONSTRAINT `fk_results_user1`
        FOREIGN KEY (`id_user`)
            REFERENCES `user` (`id_user`)
            ON DELETE NO ACTION
            ON UPDATE NO ACTION,
    CONSTRAINT `fk_results_sentiment1`
        FOREIGN KEY (`sentiment_id_sentiment`)
            REFERENCES `sentiment` (`id_sentiment`)
            ON DELETE NO ACTION
            ON UPDATE NO ACTION
);

-- -----------------------------------------------------
-- Table `answers`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `answers`
(
    `id_answer` INT          NOT NULL AUTO_INCREMENT,
    `id_faq`    INT          NOT NULL,
    `answer`    VARCHAR(200) NOT NULL,
    PRIMARY KEY (`id_answer`),
    CONSTRAINT `fk_answers_frequent_asked_question`
        FOREIGN KEY (`id_faq`)
            REFERENCES `frequent_asked_question` (`id_faq`)
            ON DELETE NO ACTION
            ON UPDATE NO ACTION
);

-- -----------------------------------------------------
-- Table `entities`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `entities`
(
    `id_entities`  INT         NOT NULL AUTO_INCREMENT,
    `score`        DECIMAL(8)  NOT NULL,
    `type`         VARCHAR(50) NOT NULL,
    `text`         VARCHAR(50) NOT NULL,
    `begin_offset` INT         NULL,
    `end_offset`   INT         NULL,
    PRIMARY KEY (`id_entities`)
);

-- -----------------------------------------------------
-- Table `results_has_entities`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `results_has_entities`
(
    `id_result_entities` INT NOT NULL AUTO_INCREMENT,
    `id_results`         INT NOT NULL,
    `id_entities`        INT NOT NULL,
    PRIMARY KEY (`id_result_entities`),
    CONSTRAINT `fk_results_has_entities_results1`
        FOREIGN KEY (`id_results`)
            REFERENCES `results` (`id_results`)
            ON DELETE NO ACTION
            ON UPDATE NO ACTION,
    CONSTRAINT `fk_results_has_entities_entities1`
        FOREIGN KEY (`id_entities`)
            REFERENCES `entities` (`id_entities`)
);

-- -----------------------------------------------------
-- Table `key_phrases`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `key_phrases`
(
    `id_key_phrases` INT         NOT NULL AUTO_INCREMENT,
    `score`          DECIMAL(8)  NOT NULL,
    `text`           VARCHAR(50) NOT NULL,
    `begin_offset`   INT         NULL,
    `end_offset`     INT         NULL,
    PRIMARY KEY (`id_key_phrases`)
);

-- -----------------------------------------------------
-- Table `results_has_key_phrases`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `results_has_key_phrases`
(
    `id_result_phrases` INT NOT NULL AUTO_INCREMENT,
    `id_results`        INT NOT NULL,
    `id_key_phrases`    INT NOT NULL,
    PRIMARY KEY (`id_result_phrases`),
    CONSTRAINT `fk_results_has_key_phrases_results1`
        FOREIGN KEY (`id_results`)
            REFERENCES `results` (`id_results`)
            ON DELETE NO ACTION
            ON UPDATE NO ACTION,
    CONSTRAINT `fk_results_has_key_phrases_key_phrases1`
        FOREIGN KEY (`id_key_phrases`)
            REFERENCES `key_phrases` (`id_key_phrases`)
            ON DELETE NO ACTION
            ON UPDATE NO ACTION
);

